        function getColor(d) {
            return d > 100000 ? '#800026' :
            d > 50000 ? '#bd0026' :
            d > 25000  ? '#e31a1c' :
            d > 10000  ? '#fc4e2a' :
            d > 5000  ? '#fd8d3c' :
            d > 2500   ? '#feb24c' :
            d > 1000   ? '#fed976' :
            d > 500   ? '#ffeda0' :
                        '#ffffcc';
        }

        function style(feature) {
            // var value = 0;
            var val = getSum(feature)
            return {
                fillColor: getColor(val),
                weight: 1,
                opacity: 1,
                color: 'black',
                // dashArray: '3',
                fillOpacity: .8
            };
        }
        
        function getSum(feature, val) {
          var val = 0;
          var arr = feature.properties.HOUR;
          for (var i = 0; i < 168 ; i++){
            val += arr[i];
          }
          console.log(val);
          return val;
        }

        };
